const initialState = {
    movies: [],
}

const rootReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'GET_USER_LIST':
            return {
                ...state,
                movies: action.payload
            }
            return state
    }
}

export default rootReducer;
